import React from "react";

const Footer = () => {
  return (
    <>
      <div className="Footer">
        {" "}
        <span>
          &copy; Beta Team 2019 -{" "}
          <a
            target="_blank"
            href="https://github.com/afazzdev/isRealease-betachat"
          >
            <i className="fab fa-github"></i>
          </a>
        </span>
      </div>
    </>
  );
};

export default Footer;
